import './App.css';
import Navbar from './navbar.jsx';
import About from './about';

function App() {
  return (
    <Router>
      <div>
        <Navbar/>
        Content will go here

        <Switch>
          <Route path="/about">
            <About />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
